import React, {Component} from 'react';
import 'antd/dist/antd.css'; // or 'antd/dist/antd.less'
import { Descriptions, Statistic } from 'antd';

class Main extends Component{
    render(){
        return (
            <div>
                <Descriptions title="Weight">
                    <Descriptions.Item>
                    <Statistic title = "Now">60.5</Statistic>
                    <Statistic title = "Already Lose">2.5</Statistic>
                    <Statistic tilte = "Goal">50</Statistic>
                    </Descriptions.Item>
                </Descriptions>
            </div>
        )
    }
}
export default Main;
